-- ----------------------------
-- View structure for Number_of_rentals
-- ----------------------------
DROP VIEW IF EXISTS `Number_of_rentals`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `Number_of_rentals` AS select `Movies`.`Title` AS `Title`,count(`Rents`.`Id_rental`) AS `Number_of_rentals` from (`Movies` join `Rents` on(`Movies`.`Id_movie` = `Rents`.`Id_movie`)) group by `Movies`.`Id_movie`;

-- ----------------------------
-- View structure for Users_rents
-- ----------------------------
DROP VIEW IF EXISTS `Users_rents`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `Users_rents` AS select concat(`Users`.`Name`,' ',`Users`.`Surname`) AS `Customer`,count(`Rents`.`Id_rental`) AS `Rents` from (`Rents` join `Users` on(`Rents`.`Id_user` = `Users`.`Id_user`)) group by concat(`Users`.`Name`,' ',`Users`.`Surname`) order by count(`Rents`.`Id_rental`) desc;

-- ----------------------------
-- Procedure structure for Active_movies_user
-- ----------------------------
DROP PROCEDURE IF EXISTS `Active_movies_user`;
delimiter ;;
CREATE PROCEDURE `Active_movies_user`(pid INT)
BEGIN
	SELECT CURRENT_DATE INTO @currdate;
	
	SELECT Movies.Title, DATEDIFF(Rents.Rent_expiration, @currdate) as Days_to_expire FROM Movies INNER JOIN Rents ON Movies.Id_movie = Rents.Id_movie WHERE Rents.Id_user = pid AND DATEDIFF(Rents.Rent_expiration, @currdate) > 0;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for Add_movie
-- ----------------------------
DROP PROCEDURE IF EXISTS `Add_movie`;
delimiter ;;
CREATE PROCEDURE `Add_movie`(`pTitle` varchar(50),`pRelease_date` date, `pAge_rest` int(10),`pGenre` varchar(50),`pDirector_name` varchar(50),`pDirector_surname` varchar(50),`pCountry` varchar(50),`pLanguage` varchar(50), pPrice DOUBLE)
BEGIN
	START TRANSACTION;
	INSERT INTO Movies (Title, Release_date, Age_restrict, Price) VALUES (pTitle, pRelease_date, pAge_rest, pPrice);
	SELECT Max(Id_movie) INTO @variable1 FROM Movies;
	
	IF (pGenre not in (select Genres.Genre_Name FROM Genres)) THEN
		INSERT INTO Genres (Genre_Name) VALUES (pGenre);
	END IF;
	
	SELECT (Id_genre) INTO @variable2 FROM Genres WHERE Genre_Name = pGenre;
	INSERT INTO `Movie_genres` (Id_movie,Id_genre) VALUES (@variable1, @variable2);
	
		IF (CONCAT(pDirector_name, pDirector_surname) not in (select CONCAT(Directors.Director_Name, Director_Surname) FROM Directors)) THEN
		INSERT INTO Directors (Director_Name, Director_Surname) VALUES (pDirector_name, pDirector_surname);
	END IF;
	
	SELECT (Id_director) INTO @variable3 from Directors WHERE Director_Name = pDirector_name AND Director_Surname = pDirector_surname;
	INSERT INTO `Movie_directors` (Id_movie, Id_director) VALUES (@variable1, @variable3);
	
		IF (pCountry not in (select Countries.Country_Name FROM Countries)) THEN
		INSERT INTO Countries (Country_Name) VALUES (pCountry);
	END IF;
	
	SELECT (Id_country) INTO @variable4 from Countries WHERE Country_name = pCountry;
	INSERT INTO `Movie_countries` VALUES (@variable1, @variable4);
	
		IF (pLanguage not in (select Languages.Language_Name FROM Languages)) THEN
		INSERT INTO Languages (Language_Name) VALUES (pLanguage);
	END IF;
	
	SELECT (Id_language) INTO @variable5 from Languages WHERE Language_Name = pLanguage;
	INSERT INTO `Movie_languages` VALUES (@variable1, @variable5);
	COMMIT;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for Add_rent
-- ----------------------------
DROP PROCEDURE IF EXISTS `Add_rent`;
delimiter ;;
CREATE PROCEDURE `Add_rent`(pId_movie INT, pRent_date DATE, pId_user INT)
BEGIN
	
	INSERT INTO Rents (Id_movie, Rent_date, Id_user) VALUES (pId_movie, pRent_date, pId_user);

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for Add_user
-- ----------------------------
DROP PROCEDURE IF EXISTS `Add_user`;
delimiter ;;
CREATE PROCEDURE `Add_user`(pname VARCHAR(20), psurname VARCHAR(20), plogin VARCHAR(20), ppassword VARCHAR(20), pemail VARCHAR(20), pPhone_number VARCHAR(9), pbirth_date DATE, pRole Varchar(20))
BEGIN
    START TRANSACTION;

    INSERT INTO Users (`Name`, `Surname`, `Login`, `Password`, `E-mail`, `Phone`, `Birth_Date`) VALUES (pname, psurname, plogin, ppassword, pemail, CONCAT('+48', pPhone_number), pbirth_date);
		
		SELECT Max(Id_user) INTO @variable1 FROM Users;
		SELECT Roles.Id_role INTO @variable2 FROM Roles WHERE Roles.Role_Name = pRole;
		
		INSERT INTO `Users_roles` (Id_user, Id_role) VALUES (@variable1, @variable2);
		
    COMMIT;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for Delete_movie
-- ----------------------------
DROP PROCEDURE IF EXISTS `Delete_movie`;
delimiter ;;
CREATE PROCEDURE `Delete_movie`(pid INT)
BEGIN
    START TRANSACTION;
        DELETE FROM Rents WHERE Rents.Id_movie = pid;
        DELETE FROM Movies WHERE Movies.Id_movie = pid;
    COMMIT;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for Delete_User
-- ----------------------------
DROP PROCEDURE IF EXISTS `Delete_User`;
delimiter ;;
CREATE PROCEDURE `Delete_User`(pid INT)
BEGIN
    START TRANSACTION;
        DELETE FROM Rents WHERE Rents.Id_user = pid;
        DELETE FROM Users WHERE Users.Id_user = pid;
    COMMIT;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for Invoice
-- ----------------------------
DROP PROCEDURE IF EXISTS `Invoice`;
delimiter ;;
CREATE PROCEDURE `Invoice`(psdate DATE, pedate DATE)
BEGIN

START TRANSACTION;

SET SESSION TRANSACTION ISOLATION LEVEL SERIALIZABLE;

	SELECT COUNT(*) AS Rents_number, ROUND(SUM(Movies.Price),2) AS Income FROM Rents INNER JOIN Movies ON Rents.Id_movie = Movies.Id_movie WHERE Rents.Rent_date >= psdate AND Rents.Rent_date < pedate; 

COMMIT;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for Searching
-- ----------------------------
DROP PROCEDURE IF EXISTS `Searching`;
delimiter ;;
CREATE PROCEDURE `Searching`(`name1` TEXT)
BEGIN
	#Routine body goes here...
select match(Title) against (`name1`in boolean mode) i, Title, Price from Movies ORDER BY i desc;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for Show_discussion
-- ----------------------------
DROP PROCEDURE IF EXISTS `Show_discussion`;
delimiter ;;
CREATE PROCEDURE `Show_discussion`(Konwersacja int)
BEGIN
    WITH recursive rec_comment AS (
    SELECT
        Comments.Comment Dyskusja, Comments.* 
    FROM
        Comments 
    WHERE
        Id_comment = Konwersacja UNION 
    SELECT
        concat(c1.Comment, '=>', c.Comment), c.*
    FROM
        Comments AS c,
        rec_comment AS c1 
WHERE
    c.Id_response = c1.Id_Comment)
    #cycle Id_comment RESTRICT
Select Dyskusja from rec_comment;

