-- ----------------------------
-- Event structure for new_partition
-- ----------------------------
DROP EVENT IF EXISTS `new_partition`;
delimiter ;;
CREATE EVENT `new_partition`
ON SCHEDULE
EVERY '1' YEAR STARTS '2024-01-01 12:00:00'
ON COMPLETION PRESERVE
DO BEGIN
		
		SET @new_year = YEAR (
		now())+ 1;
	
SET @SQL = concat( 'alter table Rents REORGANIZE partition newest into (PARTITION p_', @new_year, 'values less than (', ( @new_year + 1 ), '), PARTITION newest values less than MAXVALUE);' );

PREPARE st1 from @sql;
execute st1;
DEALLOCATE prepare st1;

END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table Invoice_items
-- ----------------------------
DROP TRIGGER IF EXISTS `Invoice_item_price_netto`;
delimiter ;;
CREATE TRIGGER `Invoice_item_price_netto` BEFORE INSERT ON `Invoice_items` FOR EACH ROW BEGIN

SET NEW.Invoice_item_price_netto = (SELECT Movies.Price_netto FROM Movies natural join Rents where Id_rental = new.Id_rental);

END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table Invoice_items
