DROP TRIGGER IF EXISTS `Invoice_item_price_brutto`;
delimiter ;;
CREATE TRIGGER `Invoice_item_price_brutto` BEFORE INSERT ON `Invoice_items` FOR EACH ROW BEGIN 

SET NEW.Invoice_item_price_brutto = ROUND(new.Invoice_item_price_netto*1.23, 2); 

END
;;
