-- ----------------------------
-- Triggers structure for table Movies
-- ----------------------------
DROP TRIGGER IF EXISTS `delete_id_movies`;
delimiter ;;
CREATE TRIGGER `delete_id_movies` BEFORE DELETE ON `Movies` FOR EACH ROW BEGIN
   DECLARE ref INT;
	 SELECT COUNT(*) INTO ref FROM Rents WHERE Id_movie = OLD.Id_movie;
	 IF ref>0 THEN
		SIGNAL SQLSTATE '45000'
			SET MESSAGE_TEXT = 'Cannot delete user with foreign key references in other table';
   END IF;
END
;;
delimiter ;

