-- ----------------------------
-- Triggers structure for table Users
-- ----------------------------
DROP TRIGGER IF EXISTS `haslo hasz`;
delimiter ;;
CREATE TRIGGER `haslo hasz` BEFORE INSERT ON `Users` FOR EACH ROW BEGIN
IF LENGTH(NEW.Password) <> 40  THEN
   SET NEW.Password = sha1(NEW.Password) ;
END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table Users
-- ----------------------------
DROP TRIGGER IF EXISTS `login-tworzenie`;
delimiter ;;
CREATE TRIGGER `login-tworzenie` BEFORE INSERT ON `Users` FOR EACH ROW BEGIN
    IF LENGTH(NEW.login) > 0 THEN
        SET NEW.login = TRIM(NEW.login);
    ELSE
        SET NEW.login = NULL;
    END IF;
    IF NEW.Login IS NULL THEN
		SET NEW.Login = CONCAT(LOWER(SUBSTRING(NEW.Name, 1, 1)), LOWER(NEW.Surname));
		END IF;
END
;;
delimiter ;

